import React from "react";

export default function Pagefooter({ postPerPage, totalPosts }) {
  const pageNumber = [];

  for (let i = 1; i <= Math.ceil(totalPosts / postPerPage); i++) {
    pageNumber.push(i);
  }
  return (
    <div className="row">
      <div className="col"></div>
      <div className="col">
        <nav aria-label="Page navigation example">
          {pageNumber.map((number) => (
            <ul class="pagination justify-content-center" key={number}>
              <li class="page-item disabled">
                <a class="page-link">Previous</a>
              </li>
              <li class="page-item">
                <a class="page-link" href="#">
                  {number}
                </a>
              </li>
              <li class="page-item">
                <a class="page-link" href="#">
                  Next
                </a>
              </li>
            </ul>
          ))}
        </nav>
      </div>
    </div>
  );
}
